import React, { useRef } from "react";
import classes from "./Header.module.css";

import KpopButton from "./KpopButton/KpopButton";
import OpeningButton from "./OpeningButton/OpeningButton";
import Button from "../UI/Button/Button";

const Header = (props) => {
 
  const kpopMusicHandler = (message) =>{
    props.onFetch(message)
  }

  return (
    <div className={classes.header}>
      <div className={classes["search-header"]}>
       <KpopButton onFetch = {kpopMusicHandler}/>
        
        <Button
          key="jpop"
          id="jpop"
          name="J-pop"
          className={classes["jpop-button"]}
        />
        <Button
          key="videogames"
          id="kpop"
          name="Videogames"
          className={classes["videogames-button"]}
        />
      </div>
      <div className={classes["user-header"]}>
        <Button className={classes["help-button"]} />
        <Button className={classes["help-button"]} />
      </div>
    </div>
  );
};

export default Header;
